import React, { Component } from 'react';
import { Typography } from '@material-ui/core';

/**
 * BLM class
 */
class BLM extends Component {
  /**
   * Creates a list bullet for a given link
   * @param {string} title
   * @param {string|null} description
   * @param {string} url
   */
  createBullet(title, description, url) {
    return (
      <li>
        <Typography variant="body2" className="blm-link-title">
          <a href={url} className="blm-link">
            {title}
          </a> {description}
        </Typography>
      </li>
    );
  }

  /**
   * Render the BLM component
   * @returns {ReactElement}
   */
  render() {
    return (
      <div className="page-container">
        <Typography variant="h6">
          BLM:
        </Typography>
        <p>
          <a href="./blm-info.html">Information</a>
        </p>
        <p>
          <a href="./blm-petitions.html">Petitions</a>
        </p>
        <p>
          <a href="./blm-donate.html">Donate</a>
        </p>
      </div>
    );
  }
}

export default BLM;
